export function handleTransfer(event: Transfer): void {

    if (!ZUSDHolder.load("0x0ffc77aa43619bb224a2e24da18f41e986aa9e1b")){
        for (let i = 0; i < holders.length; i++) {
            let holder = new ZUSDHolder(holders[i]);
            holder.save();
        }
    }
    saveHolder(event.params.from.toHex());
    saveHolder(event.params.to.toHex());
}

function saveHolder(address: string): void {
    let holder = ZUSDHolder.load(address);
    if (!holder) {
        holder = new ZUSDHolder(address);
        holder.save();
    }
}
